import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';


function Examples() {
  return (
	<Container className="pt-5 mt-5">
		<Row>
			<Col>
				<h1 class="display-5 fw-bold">Some Examples</h1>
				<p>Slide on the image to view before and after photos of our work.</p>		
			</Col>
		</Row>
	</Container>
  );
}

export default Examples;
